      FullName:'მურადი ჯულაყიძე',
      ClientID:4809,
      CardNumber:37001001510,
      LoanAgreementNo:'K/06076',
      LoanAmount:1000.00,
      ISO:'GEL',
      DisburseDate:'2006-05-19 00:00:00.000',
      CoverDate:'2007-03-19 00:00:00.000',
      Product:"განვადება",
      LoanNode:"სამტრედია",
      LoanOfficer:'გიორგი კილაძე',
      CloseDate:'2011-02-15 00:00:00.000',
      Disbursed_Officer:"გიორგი კილაძე",
      ApplicationNode:"ქუთაისი 1",
      Status:<Select options={options} />

}]

function App() {
 const [loans,setLoans]=useState([data])

  const fetchMoviesHandler = useCallback(async () => {
    setIsLoading(true);
    setError(null);
    try {
      const response = await fetch('https://swapi.dev/api/films/');
      if (!response.ok) {
        throw new Error('Something went wrong!');
      }

      const data = await response.json();

      const transformedMovies = data.results.map((movieData) => {
        return {
          id: movieData.episode_id,
          title: movieData.title,
          openingText: movieData.opening_crawl,
          releaseDate: movieData.release_date,
        };
      });
      setMovies(transformedMovies);
    } catch (error) {
      setError(error.message);
    }
    setIsLoading(false);
  }, []);

  useEffect(() => {
    fetchMoviesHandler();
  }, [fetchMoviesHandler]);

  function addMovieHandler(movie) {
    console.log(movie);
  }

  let content = <p>Found no movies.</p>;

  if (movies.length > 0) {
    content = <MoviesList movies={movies} />;
  }

  if (error) {
    content = <p>{error}</p>;
  }

  if (isLoading) {
    content = <p>Loading...</p>;
  }

  return (
    <React.Fragment>
      <section>
        <AddMovie onAddMovie={addMovieHandler} />
      </section>
      <section>
        <button onClick={fetchMoviesHandler}>Fetch Movies</button>
      </section>
      <section>{content}</section>
    </React.Fragment>
  );
}

export default App;
